import React from 'react';
import ReactDOM from 'react-dom';
import './index.css';
import App from './App';
import * as serviceWorker from './serviceWorker';
import HelloWorld from './HelloWorld';
import CountingMachine from './CountingMachine';
import Caculator from './Caculator';
import './caculator.css';

ReactDOM.render(<App />, document.getElementById('root'));
ReactDOM.render(<HelloWorld />, document.getElementById('hello-world'));
ReactDOM.render(<CountingMachine />, document.getElementById('counting-section'));
ReactDOM.render(<CountingMachine />, document.getElementById('counting-section2'));
ReactDOM.render(<Caculator key="Caculator's" />, document.getElementById('caculator'));
// If you want your app to work offline and load faster, you can change
// unregister() to register() below. Note this comes with some pitfalls.
// Learn more about service workers: http://bit.ly/CRA-PWA
serviceWorker.unregister();
